const Example = () => {
  const people = [
    { name: 'Geo', age: 18, Hobby: 'Sports' },
    { name: 'John', age: 20, Hobby: 'Music' },
    { name: 'Mike', age: 22, Hobby: 'Reading' },
  ];

  const peopleList = people.map((person) => {
    return <li key={person.name}>Name: {person.name}</li>;
  });
  return (
    <>
      <ul>{peopleList}</ul>
    </>
  );
};

export default Example;
